import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { View, Text, StyleSheet, TextInput, Button, Image, ScrollView, TouchableOpacity } from 'react-native';
import { personList } from '../Application/Classes/testDataGenerator';

const PersonDetail = () => {
    const { id } = useParams();
    const navigate = useNavigate();

    // Sucht die Person anhand der ID
    const person = personList.find((p) => p.personenNr.toString() === id);

    if (!person) {
        return (
            <View style={styles.container}>
                <Text style={styles.error}>Person nicht gefunden!</Text>
                <Button title="ZurÃ¼ck zur Personenliste" onPress={() => navigate('/persons')} />
            </View>
        );
    }

    return (
        <ScrollView contentContainerStyle={styles.scrollContainer}>
            {/* Header-Bereich */}
            <View style={styles.header}>
                <View style={styles.headerLeft}>
                    <Text style={styles.nameText}>{person.vorname} {person.nachname}</Text>
                </View>
                <View style={styles.headerRight}>
                    <Image source={{ uri: 'https://via.placeholder.com/150' }} style={styles.placeholderImage} />
                </View>
            </View>

            {/* Navigationsleiste */}
            <View style={styles.navBar}>
                {['Allgemein', 'Kontakte', 'Zuordnung', 'Einbringer', 'KÃ¼nstler', 'Exponate', 'Verrechnung', 'USW'].map((label, index) => (
                    <TouchableOpacity key={index} style={styles.navButton}>
                        <Text style={styles.navText}>{label}</Text>
                    </TouchableOpacity>
                ))}
            </View>

            {/* Formular-Bereich */}
            <View style={styles.formContainer}>
                {/* Linker Teil */}
                <View style={styles.formSection}>
                    <FormField label="Personen-Nummer:" value={person.personenNr} />
                    <FormField label="Betreuer:" value={person.betreuer || ''} />
                    <FormField label="Korrespondenz:" value={person.korrespondenz || ''} />
                    <FormField label="Sprache:" value={person.sprache || ''} />
                    <FormField label="Anrede:" value={person.anrede || ''} />
                    <FormField label="Titel-Extra:" value="" />
                    <FormField label="Titel-Vorgestellt:" value="" />
                    <FormField label="Vorname:" value={person.vorname} />
                    <FormField label="Nachname:" value={person.nachname} />
                </View>

                {/* Rechter Teil */}
                <View style={styles.formSection}>
                    <LargeTextField label="Bemerkung" />
                    <LargeTextField label="PersÃ¶nliches" />
                </View>
            </View>
        </ScrollView>
    );
};

const FormField = ({ label, value }) => (
    <View style={styles.fieldContainer}>
        <Text style={styles.fieldLabel}>{label}</Text>
        <TextInput style={styles.inputField} defaultValue={value} placeholder="Eingeben..." />
    </View>
);

const LargeTextField = ({ label }) => (
    <View style={styles.largeFieldContainer}>
        <Text style={styles.fieldLabel}>{label}</Text>
        <TextInput
            style={styles.largeInputField}
            placeholder="Eingeben..."
            multiline
            numberOfLines={4}
        />
    </View>
);

const styles = StyleSheet.create({
    scrollContainer: {
        padding: 20,
        backgroundColor: '#f9f9f9',
    },
    header: {
        flexDirection: 'row',
        justifyContent: 'space-between',
        alignItems: 'center',
        marginBottom: 20,
    },
    headerLeft: {
        flex: 1,
    },
    nameText: {
        fontSize: 28,
        fontWeight: 'bold',
        color: 'rgba(240,175,77,1)',
    },
    headerRight: {
        flex: 1,
        alignItems: 'flex-end',
    },
    placeholderImage: {
        width: 150,
        height: 150,
        borderRadius: 5,
        backgroundColor: '#ddd',
    },
    navBar: {
        flexDirection: 'row',
        justifyContent: 'space-around',
        backgroundColor: 'rgba(240,175,77,1)',
        paddingVertical: 10,
        marginBottom: 20,
        borderRadius: 5,
    },
    navButton: {
        paddingHorizontal: 10,
    },
    navText: {
        color: '#fff',
        fontWeight: 'bold',
    },
    formContainer: {
        flexDirection: 'row',
        justifyContent: 'space-between',
    },
    formSection: {
        flex: 1,
        padding: 10,
    },
    fieldContainer: {
        marginBottom: 15,
    },
    fieldLabel: {
        fontSize: 16,
        fontWeight: 'bold',
        marginBottom: 5,
    },
    inputField: {
        borderWidth: 1,
        borderColor: '#ddd',
        borderRadius: 5,
        padding: 10,
        backgroundColor: '#fff',
    },
    largeFieldContainer: {
        marginBottom: 20,
    },
    largeInputField: {
        borderWidth: 1,
        borderColor: '#ddd',
        borderRadius: 5,
        padding: 10,
        backgroundColor: '#fff',
        height: 100,
    },
    error: {
        color: 'red',
        fontSize: 20,
        textAlign: 'center',
        marginBottom: 20,
    },
});

export default PersonDetail;
